// let GM='GM';
let GA='GA';
let GN='GN';

let gmAction=()=>{
    let GM ={type:GM}
} 
let gaAction=()=>{
    return{type:GA}
}
let gnAction=()=>{
    return{type:GN}
}
export {gmAction,gaAction,gnAction,GA,GN}
